- input: "TEXT\x1CC00477323\x1C.TEXT\x1C\x1CF3A\x1CIn response to letter dated January
    7, 2011 the following corrective actions were taken:  1.  Many of the contributions
    that were not on 48 hour reports were from a credit card payments that we did
    not receive until 11/5/10.  Therefore, all of these contributions were changed
    to be 11/5/10.  2.  Bennett York did give an in kind for rent that we were not
    aware of until after the 48 hour report deadline.  3.  London and Stetelman Realtors
    was a split transaction and neither party gave over $1,000.  Therefore, this was
    not filed on a 48 hour report.  4.  The Republican Natonal Committee contribution
    of $5,000 was a wire transfer that we were not aware of until after the 48 hour
    report filing deadline.\n"
